}

    let days = [
        "Mon",
        "Tue",
        "Wed",
        "Thurs",
        "Fri",
        "Sat",
        "Sun",
      ];






    let forecastdays = [];


    function getDays(){


        let Day = loadDate();
        let indexday = days.indexOf(Day)

        console.log(Day , indexday);
        for (let step = 0; step < 5; step++) {
            // Runs 5 times, with values of step 0 through 4.
            if (indexday === 6){
                indexday = 0;
                day = days[indexday];
                forecastdays = forecastdays+day;

              }else{
                indexday = indexday+1
                day = days[indexday];
                forecastdays = forecastdays+day;
              }
          }

        forecastdays.map((day) => {
          if (indexday === 6){
            indexday = 0;
            day = days[indexday];
            return(day);

          }else{
            indexday = indexday+1
            day = days[indexday];
            return(day);
          }

        });

    }


      function loadDate() {
        let now = new Date();
        let day = days[now.getDay()];

        return(day);
      }



    return(
    <div className="Forecast">
        <div className="row">
            <div className="col-sm-2">
                <div className="day" >{forecastdays[0]}</div>
                <img src={src1} alt="" className="weathericon"></img>
                <div className="dayTemp"> <span>{Math.round(props.forecast[0].temp)}</span>˚</div> 
            </div>
            <div className="col-sm-2">
                <div className="day">{props.forecast[1].date}</div>
                <img src={src2} alt="" className="weathericon"></img> 
                <div className="dayTemp"> <span>{Math.round(props.forecast[1].temp)}</span>˚</div>

            </div>
            <div className="col-sm-2">
                <div className="day">{props.forecast[2].date}</div>
                <img src={src3} alt="" className="weathericon"></img> 
                <div className="dayTemp"> <span>{Math.round(props.forecast[2].temp)}</span>˚</div>

            </div>
            <div className="col-sm-2">
                 <div className="day">{props.forecast[3].date}</div>
                 <img src={src4} alt="" className="weathericon"></img>
                <div className="dayTemp"> <span>{Math.round(props.forecast[3].temp)}</span>˚</div> 

            </div>
            <div className="col-sm-2">
                <div className="day">{props.forecast[4].date}</div>
                <img src={src5} alt="" className="weathericon"></img> 
                <div className="dayTemp"> <span>{Math.round(props.forecast[4].temp)}</span>˚</div>

            </div>
        </div>

    </div>
    );

